default void writeNamedListAsArrMap(String name, NamedList val) throws IOException {
  int sz = val.size();
  indent();
  writeArrayOpener(sz);
  incLevel();

  boolean first = true;
  for (int i = 0; i < sz; i++) {
    String key = val.getName(i);

    if (first) {
      first = false;
    } else {
      writeArraySeparator();
    }

    indent();

    if (key == null) {
      writeVal(null, val.getVal(i));
    } else {
      writeMapOpener(1);
      writeKey(key, true);
      writeVal(key, val.getVal(i));
      writeMapCloser();
    }

  }

  decLevel();
  writeArrayCloser();
}

